import React from "react";
import logo from "./logo.svg";
import "./App.css";
import FeatureItem from "./FeatureItem/FeatureItem.js";

function App() {
  const handleQuoteChange = symbol => {};
  return (
    <div className="App">
      <header className="App-header">
        <FeatureItem
          src={logo}
          symbol="symbol"
          name="New Subscribers"
          price="5,097"
          day_change="+"
          change_pct="33.45"
          color="green"
        />
        <FeatureItem
          src={logo}
          symbol="symbol"
          name="Streams"
          price="47,403"
          day_change="-"
          change_pct="112.45"
          color="red"
        />
        <FeatureItem
          src={logo}
          symbol="symbol"
          name="Engagement Rate"
          price="25.81"
          day_change="+"
          change_pct="62.52"
          color="green"
        />
        <FeatureItem
          src={logo}
          symbol="symbol"
          name="Average Watch Time"
          price="45,4 min"
          day_change="+"
          change_pct="4.46"
          color="green"
        />
      </header>
    </div>
  );
}

export default App;
